query:
/*+ NoHashJoin(p l) */ select 100.0 * sum(case when p.p_type LIKE 'PROMO%' then l.l_extendedprice * 1 - l.l_discount else 0 end) / sum(l.l_extendedprice * 1 - l.l_discount) AS promo_revenue
from part AS p
inner join lineitem AS l
on l.l_partkey = p.p_partkey AND l.l_shipdate >= '1995-02-01'::date AND l.l_shipdate < '1995-02-01'::date + '1'::interval(2);
